(1, 64, 'Historia de la facultad', 'historia-de-la-facultad', '<p style=\"text-align: center;\"><img src=\"images/uady_logo_amarillo.png\" alt=\"\" width=\"139\" height=\"229\" /></p>\r\n<p>En el mes de septiembre de 1960 se celebr en Yucatn el IV Congreso de la Sociedad Matemtica Mexicana, despus del cual se reunieron maestros de Matemticas y Fsica de la Escuela Preparatoria y de la Facultad de Ingeniera de Universidad de Yucatn para elaborar un plan, cuyo objetivo sera la creacin de un Departamento de Estudios Fsicos-Matemticos para promover el inters de estas ciencias y difundirlas, as como la preparacin de los maestros encargados de impartirlas.</p>\r\n<p>El acta de constitucin del departamento de Estudios Fsico-Matemticos, as como sus reglamentos, es de fecha 26 de octubre de 1960; sin embargo fu hasta el 6 de febrero de 1962, que el Consejo Universitario lo reconoci oficialmente, cambindole el nombre por Centro de Estudios Fsico-Matemticos, el cual se inaugur el 24 de septiembre de 1962.</p>\r\n<p>Sus objetivos primordiales fueron \"promover la aficin y el estudio de ambas ciencias mediante cursillos, conferencias, publicaciones, etc., as como mejorar la enseanza principal mente de las Matemticas, de acuerdo con las corrientes de la didctica moderna\".</p>\r\n<p>El centro de Estudios Fsico-Matemticos tuvo como director el Ing. Carlos Romero Campos y como secretario al Br. Enrique Crdenas Prez-Abreu, contaba con quince miembros.</p>\r\n<p>La Escuela de Matemticas fue inaugurada el 20 de septiembre de 1963 por el Rector de la Universidad de Yucatn, Abog. Francisco Repetto Miln, teniendo como antecedente el Centro de Estudios Fsico-Matemticos. Comenz a funcionar en salones del tercer piso del edificio central de la Universidad de Yucatn, en el cual permaneci 14 aos. Posteriormente se traslad al local de la Facultad de Ingeniera en los ex-terrenos del Fnix donde permaneci durante 9 aos, y en mayo de 1986 se reubic sobre Circuito Colonias frente a la Unidad Habitacional Morelos.</p>\r\n<p>Actualmente y desde el mes de mayo de 2003, las instalaciones de la Facultad de Matemticas estn ubicadas en Anillo Perifrico Norte Km. 33.5 y forma parte del Campus de Ingeniera y Ciencias Exactas de la Universidad Autnoma de Yucatn.</p>', '', 1, 8, '2020-02-07 03:45:57', 135, '', '2020-03-21 06:30:26', 135, 0, '0000-00-00 00:00:00', '2020-02-07 03:45:57', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"1\",\"info_block_position\":\"\",\"info_block_show_title\":\"0\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"0\",\"link_parent_category\":\"0\",\"show_associations\":\"0\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"0\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 8, '', '', 1, 72, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(2, 66, 'INICIO', 'inicio', '<p>On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pain</p>', '', 1, 8, '2020-02-07 04:00:08', 135, '', '2020-04-02 22:46:46', 135, 0, '0000-00-00 00:00:00', '2020-02-07 04:00:08', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 7, '', '', 1, 1661, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(3, 68, 'Misin y Visin (Objetivos)', 'mision-y-vision-objetivos', '<p style=\"text-align: center;\"><img style=\"margin-right: 140px; margin-left: 140px;\" src=\"images/logoLCC.jpg\" width=\"750\" height=\"154\" /></p>\r\n<p style=\"text-align: justify;\">El propsito del plan de estudios de la Licenciatura en Ciencias de la Computacin es:</p>\r\n<p style=\"text-align: justify;\"><b><i>Formar profesionales competentes en el rea de las ciencias de la computacin para desarrollar y gestionar tecnologa computacional; realizar actividades de investigacin cientfica; disear e implementar software de base y software de aplicacin, novedosos y eficientes; considerando la estructura, operacin y necesidades de informacin de las organizaciones, con apego a la tica profesional y el servicio a la sociedad.</i></b></p>\r\n<div style=\"text-align: center;\"><iframe src=\"https://www.youtube.com/embed/paP45j1LIsM\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>', '', 1, 8, '2020-02-07 06:52:00', 135, '', '2020-03-21 06:41:06', 135, 0, '0000-00-00 00:00:00', '2020-02-07 06:52:00', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 6, '', '', 1, 21, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(4, 69, 'Perfil de ingreso (Objetivos)', 'perfil-de-ingreso-objetivos', '<p></p>\r\n<p style=\"text-align: center;\"><img src=\"images/logoLCC.jpg\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\">Las competencias deseables, para el perfil de ingreso, seleccionadas de entre las establecidas para el Sistema Nacional de Bachillerato, segn el acuerdo 444 de la SEP, son:</p>\r\n<p style=\"text-align: justify;\"><b><i>Matemticas</i></b></p>\r\n<ol type=\"1\">\r\n<li style=\"text-align: justify;\">Construye e interpreta modelos matemticos mediante la aplicacin de procedimientos aritmticos, algebraicos, geomtricos y variacionales, para la comprensin y anlisis de situaciones reales, hipotticas o formales.</li>\r\n<li style=\"text-align: justify;\">Formula y resuelve problemas matemticos, aplicando diferentes enfoques.</li>\r\n<li style=\"text-align: justify;\">Explica e interpreta los resultados obtenidos mediante procedimientos matemticos y los contrasta con modelos establecidos o situaciones reales.</li>\r\n<li style=\"text-align: justify;\">Argumenta la solucin obtenida de un problema, con mtodos numricos, grficos, analticos o variacionales, mediante el lenguaje verbal, matemtico y el uso de las tecnologas de la informacin y la comunicacin.</li>\r\n<li style=\"text-align: justify;\">Analiza las relaciones entre dos o ms variables de un proceso social o natural para determinar o estimar su comportamiento.</li>\r\n<li style=\"text-align: justify;\">Cuantifica, representa y contrasta experimental o matemticamente las magnitudes del espacio y las propiedades fsicas de los objetos que lo rodean.</li>\r\n<li style=\"text-align: justify;\">Elige un enfoque determinista o uno aleatorio para el estudio de un proceso o fenmeno, y argumenta su pertinencia.</li>\r\n<li style=\"text-align: justify;\">Interpreta tablas, grficas, mapas, diagramas y textos con smbolos matemticos y cientficos.</li>\r\n</ol>', '', 1, 8, '2020-02-07 06:58:01', 135, '', '2020-03-21 06:40:30', 135, 0, '0000-00-00 00:00:00', '2020-02-07 06:58:01', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 15, 5, '', '', 1, 34, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(5, 70, 'Librera con realidad aumentada', 'libreria-con-realidad-aumentada', '<p style=\"text-align: justify;\">La biblioteca del Campus de Ciencias Exactas e Ingeniera ofrece ms de 48,568 volmenes y en muchas ocasiones requiere mucho tiempo la bsqueda de uno de stos. Una aplicacin basada en Realidad Aumentada propone resolver el desconocimiento espacial de los usuarios de la biblioteca.</p>\r\n', '\r\n<p style=\"text-align: justify;\">Con una coleccin de ms de 48,568 volmenes en la biblioteca de Ingeniera y Ciencias Exactas de la Universidad Autnoma de Yucatn, la tarea de buscar un libro puede requerir mucho tiempo y ser muy frustrante, especialmente para los alumnos que estn conociendo apenas las instalaciones. El sistema desarrollado implementa una aplicacin basada en Realidad Aumentada (AR) que tiene como objetivo resolver el desconocimiento espacial de los usuarios en la biblioteca, al brindarnos un sistema de bsqueda en estanteras mediante Realidad Aumentada. Esta aplicacin ayuda a los estudiantes y a los usuarios en general, al proporcionar una gua mvil con los servicios de informacin de la biblioteca. En el artculo escrito por el autor del sistema, se presentan los resultados de un estudio piloto que demuestran que las experiencias y el rendimiento del usuario en la biblioteca se mejoraron mediante el uso de tecnologa de realidad aumentada.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_1_Cevera_Uribe{/gallery}</p>\r\n<h4>Trabajo Ralizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_1_Cevera_Uribe/cerverauribe2017.pdf{/aridoc}</p>\r\n<p></p>', 1, 11, '2020-02-07 07:28:28', 135, '', '2020-04-12 15:06:55', 135, 0, '0000-00-00 00:00:00', '2020-02-07 07:28:28', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_1_Cevera_Uribe\\/Captura de pantalla 2019-09-23 a la(s) 12.19.29.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 24, 3, '', '', 1, 75, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(6, 77, 'Modelado 3D de Nave de Star Wars', 'modelado-3d-de-nave-de-star-wars', '<p>Este artculo muestra la realizacin del modelado 3D de la nave XWing de Start Wars.</p>\r\n', '\r\n<p>En este proyecto, se realiz un modelado 3D de la nave XWing de la saga de Star Wars, agregndole animaciones bsicas y una escenografa para simular una escena de la pelcula.</p>\r\n<p>En el siguiente documento se muestra todo lo que conllev realizar el modelado:</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_10_Modelado3D_Nave/Proy_Integrador_Nave.pdf{/aridoc}</p>\r\n<p></p>', 1, 10, '2020-02-28 09:38:21', 135, '', '2020-04-12 14:28:35', 135, 0, '0000-00-00 00:00:00', '2020-02-28 09:38:21', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/nave_star_wars.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_i