(7, 80, 'Simulador de Sistema Operativo y Lenguaje Ensamblador', 'simulador-de-sistema-operativo-y-lenguaje-ensamblador', '<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambin el software que permite traducir cdigo fuente escrito en ensamblador a cdigo de mquina del simulador.</p>\r\n', '\r\n<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambin el software que permite traducir cdigo fuente escrito en ensamblador a cdigo de mquina del simulador; adems de otras herramientas de programacin de sistemas, como son: traductores, editores y subrutinas del sistema operativo. El programa, simula una computadora virtual con una arquitectura simplificada y mdulos para generar ejecutables a partir del lenguaje ensamblador, un mdulo para manejo de procesos, mdulo para manejo de memoria y una seccin para el control de simulaciones. El simulador permite a los usuarios implementar rutinas para ampliar las funcionalidades del sistema. El simulador tambin se puede emplear para hacer prcticas para ayudar en la comprensin de la arquitectura de las computadoras, el manejo de lenguaje mquina, el manejo de lenguaje ensamblador y el funcionamiento de un sistema operativo con sus algoritmos de gestin.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_3_Ayala{/gallery}</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_3_Ayala/IJCTT-V51P109.pdf{/aridoc}</p>\r\n<p></p>', 1, 9, '2020-03-04 23:35:11', 135, '', '2020-04-11 20:44:30', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:35:11', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/Collage 2020-03-13 01_49_44.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 19, 7, '', '', 1, 82, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(8, 81, 'Laboratorio de Interconexin Inalmbrica', 'laboratorio-de-interconexion-inalambrica', '<p>Se disen un laboratorio para representar un ambiente de interconexion movil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y camaras de video vigilancia.</p>\r\n', '\r\n<p>Se disen un laboratorio para representar un ambiente de interconexion movil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y camaras de video vigilancia. Este entorno se utiliza para la realizacin de practicas y proyectos para las materias de computacion impartidas en la Facultad de Matematicas. El sistema permite analizar el proceso de la comunicacion, los protocolos de red y sus caracteristicas, esto como tema de estudio de los modelos OSI y TCP/IP. Tambin, se utilizan equipos de video vigilancia y se obtiene video en tiempo real como datos utilizables por otras aplicaciones.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_9_Cervera{/gallery}</p>\r\n<h4>Manual de Utilizacin</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_9_Cervera/Modelo_Didactico_manual_Laboratorio_de_interconexion.pdf{/aridoc}</p>', 1, 12, '2020-03-04 23:39:00', 135, '', '2020-04-11 20:45:56', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:39:00', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/Captura de pantalla 2019-09-23 a la(s) 13.32.23.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 13, 2, '', '', 1, 25, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(9, 82, 'Uno Aritmtico ', 'uno-aritmetico', '<p>Se adapto el juego de mesa UNO a una aplicacion movil que implementa lasoperaciones aritmeticas basicas y fomenta asi el pensamiento aritmetico.</p>\r\n', '\r\n<p>Desarrolla en los ninos habilidades para manejar las cuatro operaciones aritmeticas basicas y fomentar asi el pensamiento aritmetico. El contenido matematico que tiene esta adaptacion consiste en las propiedades de los numeros reales. Se adapto el juego de mesa UNO a una aplicacion movil para el dispositivo Samsung Galaxy Tab de 10 pulgadas, sin embargo, se modifico para ser ejecutado en otros dispositivos como los smartphones, con diversas capacidades de procesamiento y diferentes tamanos de pantallas. Se puede jugar en modalidad de un jugador, dos y hasta cuatro jugadores.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_4_Basto_Uno{/gallery}</p>\r\n<h4>Manual de Usuario Uno Aritmtico</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"650\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_4_Basto_Uno/Manual_Usuario_Uno_Aritmetico.pdf{/aridoc}</p>\r\n<p></p>', 1, 10, '2020-03-04 23:39:46', 135, '', '2020-04-11 20:47:21', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:39:46', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/Captura de pantalla 2019-09-23 a la(s) 13.01.43.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 41, 7, '', '', 1, 97, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(11, 84, 'Vehculos Autnomos: Deteccin de obstculos con la aplicacin de redes neuronales convolucionales', 'vehiculos-autonomos-deteccion-de-obstaculos-con-la-aplicacion-de-redes-neuronales-convolucionales', '<p>Se propone el desarrollo de un modelo neuronal CNN con arquitectura codificadora-decodificadora para la clasificacin de obstculos en imgenes de un sistema de visin monocular, a cargo de L.C.C. Albert Aarn Cervera Uribe.</p>\r\n', '\r\n<p>En aos recientes, el uso de CNNs ha llevado al desarrollo de trabajos notables en clasificacin de imgenes, sin embargo, en tareas de vehculos autnomos, la salida deseada de la red debe incluir no slo la etiqueta de prediccin, pero la localizacin de objetos de inters preferentemente a nivel de pxeles.</p>\r\n<p>Este trabajo propone el desarrollo de un modelo neuronal CNN con arquitectura codificadora-decodificadora para la deteccin de obstculos en imgenes de un sistema de visin monocular para vehculos autnomos.</p>\r\n<p>En este reporte se muestran los resultados obtenidos en materia de deteccin de obstculos con la aplicacin de redes neuronales convolucionales.</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_2_Cervera_Uribe/Towards_Autonomous_Vehicles_with_CNN_[Albert_Cervera-Uribe].pdf{/aridoc}</p>', 1, 11, '2020-03-05 08:17:18', 135, '', '2020-04-12 16:45:38', 135, 0, '0000-00-00 00:00:00', '2020-03-05 08:17:18', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_2_Cervera_Uribe\\/vehiculos_autonomos.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show