(19, 137, 'Juego Matemtico de la Cultura Maya: MATYA', 'juego-maya-matya', '<p style=\"text-align: justify;\">Diseo e Implementacin de un videojuego didctico que apoya a estudiantes de primaria reforzando el estudio de la nocin de fraccin. Los escenarios son creados por herramientas de modelado en 2D, 3D.</p>\r\n', '\r\n<p style=\"text-align: justify;\">Diseo e Implementacin de un videojuego didctico conformado de varias actividades, con el propsito de que los estudiantes de primaria, en especial los educandos de sexto grado, refuercen el estudio de la nocin de fraccin. Este juego es creado considerando un avatar, cuya accin de movimiento para el usuario es en tercera persona. Los escenarios son creados por herramientas de modelado en 2D, 3D y exportado a un formato que entienda el motor de juegos XNA.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_8_MaderaBastoMATYA{/gallery}</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_8_MaderaBastoMATYA/MATYA_Proyecto.pdf{/aridoc}</p>\r\n<p><video controls=\"controls\" width=\"100%\" height=\"100%\">\r\n  <source src=\"videos/videojuegoMusic.mp4\" type=\"video/mp4\" />\r\nYour browser does not support the video tag.</video></p>', 1, 10, '2020-04-03 12:56:44', 136, '', '2020-04-12 16:24:06', 135, 0, '0000-00-00 00:00:00', '2020-04-03 12:56:44', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/matya.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_bloc