(22, 102, 'Propsito del sitio', 'proposito-del-sitio', '<p>El portal Jvenes en las Ciencias de la Computacin es un espacio para compartir materiales de divulgacin cientfica en el rea de las Ciencias de la Computacin e informacin de productos generados por la comunidad de los programas de computacin de la Facultad de Matemticas.</p>\r\n<p>Se incluyen secciones con informacin escrita en lenguaje accesible para los jvenes y en diversos formatos: artculos, infografas, videos y galeras fotogrficas.</p>\r\n<p>El espacio <strong>Futuro y Ciencia</strong>, est dedicado a la publicacin de contenido sobre las diversas reas de las Ciencias de la Computacin: inteligencia artificial, redes de computadoras, realidad virtual, aprendizaje automtico, internet de las cosas, etc. Es posible recibir aportaciones de alumnos, profesores o divulgadores de la ciencia externos a la institucin, siguiendo los lineamientos correspondientes.</p>\r\n<p>Nuestro sitio est dirigido a adolescentes y adultos que buscan conocer con mayor detalle lo que se estudia en la carrera de Ciencias de la Computacin y acceder a material de divulgacin cientfica y comprender las aplicaciones que tiene las Ciencias de la Computacin en la vida cotidiana.</p>', '', 1, 8, '2020-03-23 21:34:02', 135, '', '2020-04-23 06:29:25', 136, 0, '0000-00-00 00:00:00', '2020-03-23 21:34:02', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category