(28, 134, ' Realidad Aumentada en un croquis 3D interactivo de la Facultad de Matemticas', 'realidad-aumentada-en-un-croquis-3d-interactivo-de-la-facultad-de-matematicas', '<p>Se realiz una aplicacin mvil de Realidad Aumentada que despliega un escenario virtual tridimensional de la facultad de matemticas</p>\r\n', '\r\n<p>Como parte de un proyecto, se realiz una aplicacin mvil de Realidad Aumentada que despliegue un escenario virtual tridimensional de la facultad de matemticas de tal manera que el usuario pueda identificar la ubicacin de edificios principales de la facultad de matemticas, as como los pasillos que dirigen a estos, desde una perspectiva general y de manera interactiva.</p>\r\n<p>En el siguiente documento se describe todo lo que conllev la realizacin del proyecto.</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_12_RealidadAumentada_FMAT/Proyecto_integrador_Alan.pdf{/aridoc}</p>\r\n<p></p>', 1, 10, '2020-04-11 16:25:28', 135, '', '2020-04-12 15:09:12', 135, 0, '0000-00-00 00:00:00', '2020-04-11 16:25:28', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_12_RealidadAumentada_FMAT\\/croquis_fmat.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 1, '', '', 1, 15, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(29, 135, 'Ubicampus, la aplicacin para ubicar salones escolares en FMAT', 'ubicampus-la-aplicacion-para-ubicar-salones-escolares-en-fmat', '<p>Aplicacin de realidad aumentada que sirve para visualizar informacin de los salones de clase y de los departamentos de la Facutlad de Matemticas</p>\r\n', '\r\n<p>Este proyecto surge de la problemtica de que muchos estudiantes que estn empezando a estudiar en la Facultad de Matemticas no pueden encontrar sus salones de clases, se pierden o no estn seguros de su saln de clases; tambin no saben ubicar bien los departamentos de la facultad.</p>\r\n<p>Se propone la creacin una aplicacin de realidad aumentada con el nombre de Ubicampus, en la cual, el usuario podr enfocar su cmara en el identificador de un saln (D3, H5), y sta arrojar una lista donde se podr visualizar cundo se ocupa el saln, por qu materia y qu maestro la imparte. De igual modo, para los departamentos de la universidad, esta aplicacin desplegar informacin referente al departamento, indicndole al usuario los servicios que ste presenta (por ejemplo, en Control Escolar se deplegar la funcin, as como trmites que puedes realizar tal como solicitud de constancias).</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_13_RealidadAumentada_Salones/ReporteFinal_Cervera.pdf{/aridoc}</p>\r\n<p></p>', 1, 10, '2020-04-11 16:26:00', 135, '', '2020-04-12 15:38:00', 135, 0, '0000-00-00 00:00:00', '2020-04-11 16:26:00', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_13_RealidadAumentada_Salones\\/clir.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 0, '', '', 1, 7, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
