(15, 'index.php?option=com_content&view=article&id=1', 'index.php?option=com_content&view=article&id=1:historia-de-la-facultad&catid=8', 'Historia de la facultad', ' En el mes de septiembre de 1960 se celebr en Yucatn el IV Congreso de la Sociedad Matemtica Mexicana, despus del cual se reunieron maestros de Matemticas y Fsica de la Escuela Preparatoria y de la Facultad de Ingeniera de Universidad de Yucatn para elaborar un plan, cuyo objetivo sera la creacin de un Departamento de Estudios Fsicos-Matemticos para promover el inters de estas ciencias y difundirlas, as como la preparacin de los maestros encargados de impartirlas. El acta de constitucin del departamento de Estudios Fsico-Matemticos, as como sus reglamentos, es de fecha 26 de octubre de 1960; sin embargo fu hasta el 6 de febrero de 1962, que el Consejo Universitario lo reconoci oficialmente, cambindole el nombre por Centro de Estudios Fsico-Matemticos, el cual se inaugur el 24 de septiembre de 1962. Sus objetivos primordiales fueron \"promover la aficin y el estudio de ambas ciencias mediante cursillos, conferencias, publicaciones, etc., as como mejorar la enseanza principal mente de las Matemticas, de acuerdo con las corrientes de la didctica moderna\". El centro de Estudios Fsico-Matemticos tuvo como director el Ing. Carlos Romero Campos y como secretario al Br. Enrique Crdenas Prez-Abreu, contaba con quince miembros. La Escuela de Matemticas fue inaugurada el 20 de septiembre de 1963 por el Rector de la Universidad de Yucatn, Abog. Francisco Repetto Miln, teniendo como antecedente el Centro de Estudios Fsico-Matemticos. Comenz a funcionar en salones del tercer piso del edificio central de la Universidad de Yucatn, en el cual permaneci 14 aos. Posteriormente se traslad al local de la Facultad de Ingeniera en los ex-terrenos del Fnix donde permaneci durante 9 aos, y en mayo de 1986 se reubic sobre Circuito Colonias frente a la Unidad Habitacional Morelos. Actualmente y desde el mes de mayo de 2003, las instalaciones de la Facultad de Matemticas estn ubicadas en Anillo Perifrico Norte Km. 33.5y forma parte del Campus de Ingeniera y Ciencias Exactas de la Universidad Autnoma de Yucatn. ', '2020-04-13 16:43:42', '8a2a119ffb1c7a781d3e9c1c05187504', 1, 1, 1, '*', '2020-02-07 03:45:57', '0000-00-00 00:00:00', '2020-02-07 03:45:57', '0000-00-00 00:00:00', 0, 0, 4, );
