(16, 'index.php?option=com_content&view=article&id=2', 'index.php?option=com_content&view=article&id=2:inicio&catid=8', 'INICIO', ' On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pain ', '2020-04-13 16:43:44', '37ef264c53ea0f4a5d41de3fbae4da7f', 1, 1, 1, '*', '2020-02-07 04:00:08', '0000-00-00 00:00:00', '2020-02-07 04:00:08', '0000-00-00 00:00:00', 0, 0, 4, ),
(17, 'index.php?option=com_content&view=article&id=3', 'index.php?option=com_content&view=article&id=3:mision-y-vision-objetivos&catid=8', 'Misin y Visin (Objetivos)', ' El propsito del plan de estudios de la Licenciatura en Ciencias de la Computacin es: Formar profesionales competentes en el rea de las ciencias de la computacin para desarrollar y gestionar tecnologa computacional; realizar actividades de investigacin cientfica; disear e implementar software de base y software de aplicacin, novedosos y eficientes; considerando la estructura, operacin y necesidades de informacin de las organizaciones, con apego a la tica profesional y el servicio a la sociedad. ', '2020-04-13 16:43:46', '3983d4ee810ee7391a52f07b4d2eff0d', 1, 1, 1, '*', '2020-02-07 06:52:00', '0000-00-00 00:00:00', '2020-02-07 06:52:00', '0000-00-00 00:00:00', 0, 0, 4, );
