(18, 'index.php?option=com_content&view=article&id=4', 'index.php?option=com_content&view=article&id=4:perfil-de-ingreso-objetivos&catid=8', 'Perfil de ingreso (Objetivos)', ' Las competencias deseables, para el perfil de ingreso, seleccionadas de entre las establecidas para el Sistema Nacional de Bachillerato, segn el acuerdo 444 de la SEP, son: Matemticas Construye e interpreta modelos matemticos mediante la aplicacin de procedimientos aritmticos, algebraicos, geomtricos y variacionales, para la comprensin y anlisis de situaciones reales, hipotticas o formales. Formula y resuelve problemas matemticos, aplicando diferentes enfoques. Explica e interpreta los resultados obtenidos mediante procedimientos matemticos y los contrasta con modelos establecidos o situaciones reales. Argumenta la solucin obtenida de un problema, con mtodos numricos, grficos, analticos o variacionales, mediante el lenguaje verbal, matemtico y el uso de las tecnologas de la informacin y la comunicacin. Analiza las relaciones entre dos o ms variables de un proceso social o natural para determinar o estimar su comportamiento. Cuantifica, representa y contrasta experimental o matemticamente las magnitudes del espacio y las propiedades fsicas de los objetos que lo rodean. Elige un enfoque determinista o uno aleatorio para el estudio de un proceso o fenmeno, y argumenta su pertinencia. Interpreta tablas, grficas, mapas, diagramas y textos con smbolos matemticos y cientficos. ', '2020-04-13 16:43:47', 'e5e6ad13135e41aa22bf7a24d5d76f55', 1, 1, 1, '*', '2020-02-07 06:58:01', '0000-00-00 00:00:00', '2020-02-07 06:58:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(19, 'index.php?option=com_content&view=article&id=5', 'index.php?option=com_content&view=article&id=5:libreria-con-realidad-aumentada&catid=11', 'Librera con realidad aumentada', ' La biblioteca del Campus de Ciencias Exactas e Ingeniera ofrece ms de 48,568 volmenes y en muchas ocasiones requiere mucho tiempo la bsqueda de uno de stos. Una aplicacin basada en Realidad Aumentada propone resolver el desconocimiento espacial de los usuarios de la biblioteca. ', '2020-04-13 16:43:48', '6b9e6f2c0dfcc9862caca67f449538fd', 1, 1, 1, '*', '2020-02-07 07:28:28', '0000-00-00 00:00:00', '2020-02-07 07:28:28', '0000-00-00 00:00:00', 0, 0, 4, ),
