(64, 'index.php?option=com_content&view=article&id=22', 'index.php?option=com_content&view=article&id=22:proposito-del-sitio&catid=8', 'Propsito del sitio', ' El portal Jvenes en las Ciencias de la Computacin es un espacio para compartir materiales de divulgacin cientfica en el rea de las Ciencias de la Computacin e informacin de productos generados por la comunidad de los programas de computacin de la Facultad de Matemticas. Se incluyen secciones con informacin escrita en lenguaje accesible para los jvenes y en diversos formatos: artculos, infografas, videos y galeras fotogrficas. El espacio Futuro y Ciencia, est dedicado a la publicacin de contenido sobre las diversas reas de las Ciencias de la Computacin: inteligencia artificial, redes de computadoras, realidad virtual, aprendizaje automtico, internet de las cosas, etc. Es posible recibir aportaciones de alumnos, profesores o divulgadores de la ciencia externos a la institucin, siguiendo los lineamientos correspondientes. Nuestro sitio est dirigido a adolescentes y adultos que buscan conocer con mayor detalle lo que se estudia en la carrera de Ciencias de la Computacin y acceder a material de divulgacin cientfica y comprender las aplicaciones que tiene las Ciencias de la Computacin en la vida cotidiana. ', '2020-04-23 01:29:26', 'deb41b0b85325eb65b793c291944e000', 1, 1, 1, '*', '2020-03-23 21:34:02', '0000-00-00 00:00:00', '2020-03-23 21:34:02', '0000-00-00 00:00:00', 0, 0, 4, );
