(5, 'com_content.article', 'Librera con realidad aumentada', 'libreria-con-realidad-aumentada', '<p style=\"text-align: justify;\">La biblioteca del Campus de Ciencias Exactas e Ingeniera ofrece ms de 48,568 volmenes y en muchas ocasiones requiere mucho tiempo la bsqueda de uno de stos. Una aplicacin basada en Realidad Aumentada propone resolver el desconocimiento espacial de los usuarios de la biblioteca.</p>\r\n', 1, '0000-00-00 00:00:00', 0, 1, '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 135, '', '2020-02-07 07:28:28', 135, '2020-04-12 15:06:55', '*', '2020-02-07 07:28:28', '0000-00-00 00:00:00', 5, 146, '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_1_Cevera_Uribe\\/Captura de pantalla 2019-09-23 a la(s) 12.19.29.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', 69, 24, 3, '', '', 11, '', 1),
