(106, 8, 1, '', '2020-03-13 10:27:27', 136, 3191, 'aa0fbae036abf85756e0acf34f50dab3fab592eb', '{\"id\":8,\"asset_id\":\"81\",\"title\":\"Laboratorio de interconexi\\u00f3n inal\\u00e1mbrica\",\"alias\":\"laboratorio-de-interconexion-inalambrica\",\"introtext\":\"<p>Se disen\\u0303\\u00f3 un laboratorio para representar un ambiente de interconexio\\u0301n mo\\u0301vil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y ca\\u0301maras de video vigilancia.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Se disen\\u0303\\u00f3 un laboratorio para representar un ambiente de interconexio\\u0301n mo\\u0301vil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y ca\\u0301maras de video vigilancia. Este entorno se utiliza para la realizaci\\u00f3n de pra\\u0301cticas y proyectos para las materias de computacio\\u0301n impartidas en la Facultad de Matema\\u0301ticas. El sistema permite analizar el proceso de la comunicacio\\u0301n, los protocolos de red y sus caracteri\\u0301sticas, esto como tema de estudio de los modelos OSI y TCP\\/IP. Tambi\\u00e9n, se utilizan equipos de video vigilancia y se obtiene video en tiempo real como datos utilizables por otras aplicaciones.<\\/p>\\r\\n<p>{gallery}Articulo_9_Cervera{\\/gallery}<\\/p>\\r\\n<h4>Manual de Utilizaci\\u00f3n<\\/h4>\\r\\n<p>{gallery}Articulo_4_Basto_Uno{\\/gallery}{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_9_Cervera\\/Modelo-Didactico-manual_Laboratorio_de_interconexion.pdf{\\/aridoc}<\\/p>\",\"state\":1,\"catid\":\"12\",\"created\":\"2020-03-04 23:39:00\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-13 10:27:27\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-13 10:26:03\",\"publish_up\":\"2020-03-04 23:39:00\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articulo_introduccion\\\\\\