(136, 6, 1, '', '2020-03-21 03:47:51', 136, 2704, 'edea50ee61647708cb8086c23b43a8333c6f24a0', '{\"id\":6,\"asset_id\":\"77\",\"title\":\"Demostraci\\u00f3n del robot Nao, programado por la alumna de la Licenciatura en Ciencias de la Computaci\\u00f3n Astrid Rodr\\u00edguez\",\"alias\":\"futuro-y-ciencia\",\"introtext\":\"<p>&lt;iframe src=\\\"https:\\/\\/www.facebook.com\\/plugins\\/video.php?href=https%3A%2F%2Fwww.facebook.com%2Fface.lcc.fmat.uady%2Fvideos%2F259506408243390%2F&amp;show_text=0&amp;width=267\\\" width=\\\"267\\\" height=\\\"476\\\" style=\\\"border:none;overflow:hidden\\\" scrolling=\\\"no\\\" frameborder=\\\"0\\\" allowTransparency=\\\"true\\\" allowFullScreen=\\\"true\\\"&gt;&lt;\\/iframe&gt;<\\/p>\\r\\n<p>&lt;iframe src=\\\"https:\\/\\/www.facebook.com\\/plugins\\/video.php?href=https%3A%2F%2Fwww.facebook.com%2Fface.lcc.fmat.uady%2Fvideos%2F2108315552763250%2F&amp;show_text=0&amp;width=267\\\" width=\\\"267\\\" height=\\\"476\\\" style=\\\"border:none;overflow:hidden\\\" scrolling=\\\"no\\\" frameborder=\\\"0\\\" allowTransparency=\\\"true\\\" allowFullScreen=\\\"true\\\"&gt;&lt;\\/iframe&gt;<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-02-28 09:38:21\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 03:47:51\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-21 03:19:49\",\"publish_up\":\"2020-02-28 09:38:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articulo_introduccion\\\\\\/robot_nao.jpg\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":3,\"ordering\":\"0\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"43\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(137, 5, 1, '', '2020-03-21 04:50:10', 136, 3626, 'eb23807be84abea0800040821adc050788f44446', '{\"id\":5,\"asset_id\":\"70\",\"title\":\"Librer\\u00eda con realidad aumentada\",\"alias\":\"libreria-con-realidad-aumentada\",\"introtext\":\"<p style=\\\"text-align: justify;\\\">\\u00a0<\\/p>\\r\\n<p>La biblioteca del Campus de Ciencias Exactas e Ingenier\\u00eda ofrece m\\u00e1s de 48,568 vol\\u00famenes y en muchas ocasiones requiere mucho tiempo la b\\u00fasqueda de uno de \\u00e9stos. Una aplicaci\\u00f3n basada en Realidad Aumentada propone resolver el desconocimiento espacial de los usuarios de la biblioteca.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p style=\\\"text-align: justify;\\\">Con una colecci\\u00f3n de m\\u00e1s de 48,568 vol\\u00famenes en la biblioteca de Ingenier\\u00eda y Ciencias Exactas de la Universidad Aut\\u00f3noma de Yucat\\u00e1n, la tarea de buscar un libro puede requerir mucho tiempo y ser muy frustrante, especialmente para los alumnos que est\\u00e1n conociendo apenas las instalaciones. El sistema desarrollado implementa una aplicaci\\u00f3n basada en Realidad Aumentada (AR) que tiene como objetivo resolver el desconocimiento espacial de los usuarios en la biblioteca, al brindarnos un sistema de b\\u00fasqueda en estanter\\u00edas mediante Realidad Aumentada. Esta aplicaci\\u00f3n ayuda a los estudiantes y a los usuarios en general, al proporcionar una gu\\u00eda m\\u00f3vil con los servicios de informaci\\u00f3n de la biblioteca. En el art\\u00edculo escrito por el autor del sistema, se presentan los resultados de un estudio piloto que demuestran que las experiencias y el rendimiento del usuario en la biblioteca se mejoraron mediante el uso de tecnolog\\u00eda de realidad aumentada.<\\/p>\\r\\n<p>{gallery}Articulo_1_Cevera_Uribe{\\/gallery}<\\/p>\\r\\n<h4>Trabajo Ralizado<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_1_Cevera_Uribe\\/cerverauribe2017.pdf{\\/aridoc}<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"11\",\"created\":\"2020-02-07 07:28:28\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 04:50:10\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-21 04:49:57\",\"publish_up\":\"2020-02-07 07:28:28\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/Articulo_1_Cevera_Uribe\\\\\\/Captura de pantalla 2019-09-23 a la(s) 12.19.29.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":20,\"ordering\":\"3\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"53\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(146, 1, 1, '', '2020-03-21 06:29:46', 135, 4330, '378b903e68b674461d66d602daa66c13fabce0eb', '{\"id\":1,\"asset_id\":\"64\",\"title\":\"Historia de la facultad\",\"alias\":\"historia-de-la-facultad\",\"introtext\":\"<p style=\\\"text-align: center;\\\"><img src=\\\"images\\/uady_logo_amarillo.png\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p>En el mes de septiembre de 1960 se celebr\\u00f3 en Yucat\\u00e1n el IV Congreso de la Sociedad Matem\\u00e1tica Mexicana, despu\\u00e9s del cual se reunieron maestros de Matem\\u00e1ticas y F\\u00edsica de la Escuela Preparatoria y de la Facultad de Ingenier\\u00eda de Universidad de Yucat\\u00e1n para elaborar un plan, cuyo objetivo ser\\u00eda la creaci\\u00f3n de un Departamento de Estudios F\\u00edsicos-Matem\\u00e1ticos para promover el inter\\u00e9s de estas ciencias y difundirlas, as\\u00ed como la preparaci\\u00f3n de los maestros encargados de impartirlas.<\\/p>\\r\\n<p>El acta de constituci\\u00f3n del departamento de Estudios F\\u00edsico-Matem\\u00e1ticos, as\\u00ed como sus reglamentos, es de fecha 26 de octubre de 1960; sin embargo fu\\u00e9 hasta el 6 de febrero de 1962, que el Consejo Universitario lo reconoci\\u00f3 oficialmente, cambi\\u00e1ndole el nombre por Centro de Estudios F\\u00edsico-Matem\\u00e1ticos, el cual se inaugur\\u00f3 el 24 de septiembre de 1962.<\\/p>\\r\\n<p>Sus objetivos primordiales fueron \\\"promover la afici\\u00f3n y el estudio de ambas ciencias mediante cursillos, conferencias, publicaciones, etc., as\\u00ed como mejorar la ense\\u00f1anza principal mente de las Matem\\u00e1ticas, de acuerdo con las corrientes de la did\\u00e1ctica moderna\\\".<\\/p>\\r\\n<p>El centro de Estudios F\\u00edsico-Matem\\u00e1ticos tuvo como director el Ing. Carlos Romero Campos y como secretario al Br. Enrique C\\u00e1rdenas P\\u00e9rez-Abreu, contaba con quince miembros.<\\/p>\\r\\n<p>La Escuela de Matem\\u00e1ticas fue inaugurada el 20 de septiembre de 1963 por el Rector de la Universidad de Yucat\\u00e1n, Abog. Francisco Repetto Mil\\u00e1n, teniendo como antecedente el Centro de Estudios F\\u00edsico-Matem\\u00e1ticos. Comenz\\u00f3 a funcionar en salones del tercer piso del edificio central de la Universidad de Yucat\\u00e1n, en el cual permaneci\\u00f3 14 a\\u00f1os. Posteriormente se traslad\\u00f3 al local de la Facultad de Ingenier\\u00eda en los ex-terrenos del F\\u00e9nix donde permaneci\\u00f3 durante 9 a\\u00f1os, y en mayo de 1986 se reubic\\u00f3 sobre Circuito Colonias frente a la Unidad Habitacional Morelos.<\\/p>\\r\\n<p>Actualmente y desde el mes de mayo de 2003, las instalaciones de la Facultad de Matem\\u00e1ticas est\\u00e1n ubicadas en Anillo Perif\\u00e9rico Norte Km. 33.5 y forma parte del Campus de Ingenier\\u00eda y Ciencias Exactas de la Universidad Aut\\u00f3noma de Yucat\\u00e1n.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-02-07 03:45:57\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 06:29:46\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-03-21 06:28:54\",\"publish_up\":\"2020-02-07 03:45:57\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"1\\\",\\\"show_intro\\\":\\\"1\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"0\\\",\\\"show_category\\\":\\\"0\\\",\\\"link_category\\\":\\\"0\\\",\\\"show_parent_category\\\":\\\"0\\\",\\\"link_parent_category\\\":\\\"0\\\",\\\"show_associations\\\":\\\"0\\\",\\\"show_author\\\":\\\"0\\\",\\\"link_author\\\":\\\"0\\\",\\\"show_create_date\\\":\\\"0\\\",\\\"show_modify_date\\\":\\\"0\\\",\\\"show_publish_date\\\":\\\"0\\\",\\\"show_item_navigation\\\":\\\"0\\\",\\\"show_icons\\\":\\\"0\\\",\\\"show_print_icon\\\":\\\"0\\\",\\\"show_email_icon\\\":\\\"0\\\",\\\"show_vote\\\":\\\"0\\\",\\\"show_hits\\\":\\\"0\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"4\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"60\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(147, 1, 1, '', '2020-03-21 06:30:26', 135, 4359, '0efa3c1c357ddf1c25308a00eaffb735bea7cccb', '{\"id\":1,\"asset_id\":\"64\",\"title\":\"Historia de la facultad\",\"alias\":\"historia-de-la-facultad\",\"introtext\":\"<p style=\\\"text-align: center;\\\"><img src=\\\"images\\/uady_logo_amarillo.png\\\" alt=\\\"\\\" width=\\\"139\\\" height=\\\"229\\\" \\/><\\/p>\\r\\n<p>En el mes de septiembre de 1960 se celebr\\u00f3 en Yucat\\u00e1n el IV Congreso de la Sociedad Matem\\u00e1tica Mexicana, despu\\u00e9s del cual se reunieron maestros de Matem\\u00e1ticas y F\\u00edsica de la Escuela Preparatoria y de la Facultad de Ingenier\\u00eda de Universidad de Yucat\\u00e1n para elaborar un plan, cuyo objetivo ser\\u00eda la creaci\\u00f3n de un Departamento de Estudios F\\u00edsicos-Matem\\u00e1ticos para promover el inter\\u00e9s de estas ciencias y difundirlas, as\\u00ed como la preparaci\\u00f3n de los maestros encargados de impartirlas.<\\/p>\\r\\n<p>El acta de constituci\\u00f3n del departamento de Estudios F\\u00edsico-Matem\\u00e1ticos, as\\u00ed como sus reglamentos, es de fecha 26 de octubre de 1960; sin embargo fu\\u00e9 hasta el 6 de febrero de 1962, que el Consejo Universitario lo reconoci\\u00f3 oficialmente, cambi\\u00e1ndole el nombre por Centro de Estudios F\\u00edsico-Matem\\u00e1ticos, el cual se inaugur\\u00f3 el 24 de septiembre de 1962.<\\/p>\\r\\n<p>Sus objetivos primordiales fueron \\\"promover la afici\\u00f3n y el estudio de ambas ciencias mediante cursillos, conferencias, publicaciones, etc., as\\u00ed como mejorar la ense\\u00f1anza principal mente de las Matem\\u00e1ticas, de acuerdo con las corrientes de la did\\u00e1ctica moderna\\\".<\\/p>\\r\\n<p>El centro de Estudios F\\u00edsico-Matem\\u00e1ticos tuvo como director el Ing. Carlos Romero Campos y como secretario al Br. Enrique C\\u00e1rdenas P\\u00e9rez-Abreu, contaba con quince miembros.<\\/p>\\r\\n<p>La Escuela de Matem\\u00e1ticas fue inaugurada el 20 de septiembre de 1963 por el Rector de la Universidad de Yucat\\u00e1n, Abog. Francisco Repetto Mil\\u00e1n, teniendo como antecedente el Centro de Estudios F\\u00edsico-Matem\\u00e1ticos. Comenz\\u00f3 a funcionar en salones del tercer piso del edificio central de la Universidad de Yucat\\u00e1n, en el cual permaneci\\u00f3 14 a\\u00f1os. Posteriormente se traslad\\u00f3 al local de la Facultad de Ingenier\\u00eda en los ex-terrenos del F\\u00e9nix donde permaneci\\u00f3 durante 9 a\\u00f1os, y en mayo de 1986 se reubic\\u00f3 sobre Circuito Colonias frente a la Unidad Habitacional Morelos.<\\/p>\\r\\n<p>Actualmente y desde el mes de mayo de 2003, las instalaciones de la Facultad de Matem\\u00e1ticas est\\u00e1n ubicadas en Anillo Perif\\u00e9rico Norte Km. 33.5 y forma parte del Campus de Ingenier\\u00eda y Ciencias Exactas de la Universidad Aut\\u00f3noma de Yucat\\u00e1n.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-02-07 03:45:57\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 06:30:26\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-03-21 06:29:46\",\"publish_up\":\"2020-02-07 03:45:57\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"1\\\",\\\"show_intro\\\":\\\"1\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"0\\\",\\\"show_category\\\":\\\"0\\\",\\\"link_category\\\"