(179, 9, 1, '', '2020-04-03 10:32:32', 135, 3050, 'fce994add9f334d6d92d1a1e5735924bafe592d0', '{\"id\":9,\"asset_id\":\"82\",\"title\":\"Uno aritm\\u00e9tico \",\"alias\":\"uno-aritmetico\",\"introtext\":\"<p>Se adapto\\u0301 el juego de mesa UNO a una aplicacio\\u0301n mo\\u0301vil que implementa las\\u00a0operaciones aritme\\u0301ticas ba\\u0301sicas y fomenta asi\\u0301 el pensamiento aritme\\u0301tico.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Desarrolla en los nin\\u0303os habilidades para manejar las cuatro operaciones aritme\\u0301ticas ba\\u0301sicas y fomentar asi\\u0301 el pensamiento aritme\\u0301tico. El contenido matema\\u0301tico que tiene esta adaptacio\\u0301n consiste en las propiedades de los nu\\u0301meros reales. Se adapto\\u0301 el juego de mesa UNO a una aplicacio\\u0301n mo\\u0301vil para el dispositivo Samsung Galaxy Tab de 10 pulgadas, sin embargo, se modifico\\u0301 para ser ejecutado en otros dispositivos como los smartphones, con diversas capacidades de procesamiento y diferentes taman\\u0303os de pantallas. Se puede jugar en modalidad de un jugador, dos y hasta cuatro jugadores.<\\/p>\\r\\n<p>{gallery}Articulo_4_Basto_Uno{\\/gallery}<\\/p>\\r\\n<h4>Manual de Usuario Uno Aritm\\u00e9tico<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"650\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_4_Basto_Uno\\/Manual_Usuario_Uno_Aritmetico.pdf{\\/aridoc}<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"10\",\"created\":\"2020-03-04 23:39:46\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-04-03 10:32:32\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-04-03 10:31:41\",\"publish_up\":\"2020-03-04 23:39:46\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articulo_introduccion\\\\\\/Captura de pantalla 2019-09-23 a la(s) 13.01.43.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_cap