(343, 25, 1, '', '2020-04-12 14:16:10', 135, 2751, 'd3bf88158d7899906d271098b51edaf162ae2054', '{\"id\":25,\"asset_id\":\"139\",\"title\":\" Aplicaci\\u00f3n de Aprendizaje Aritm\\u00e9tico \\\"Quita y Pon\\\"\",\"alias\":\"aplicacion-de-aprendizaje-aritmetico-quita-y-pon\",\"introtext\":\"<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Este juego en una aplicaci\\u00f3n m\\u00f3vil que consiste en completar operaciones aritm\\u00e9ticas, de diferentes grados de dificultad, con los operadores y operandos adecuados para resolver correctamente la misma.<\\/p>\\r\\n<p>{gallery}articulos\\/esto_hacemos\\/Articulo_7_Basto_QuitayPon{\\/gallery}<\\/p>\\r\\n<h4>Manual de Usuario \\\"Quita y Pon\\\":<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"650\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/articulos\\/esto_hacemos\\/Articulo_7_Basto_QuitayPon\\/Manual_Usuario-QuitayPon.pdf{\\/aridoc}<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"10\",\"created\":\"2020-04-03 13:30:33\",\"created_by\":\"136\",\"created_by_alias\":\"\",\"modified\":\"2020-04-12 14:16:10\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-04-12 14:15:49\",\"publish_up\":\"2020-04-03 13:30:33\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articulos\\\\\\/esto_hacemos\\\\\\/Articulo_7_Basto_QuitayPon\\\\\\/imagen1.jpg\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"t